import { configureStore } from '@reduxjs/toolkit'
import auth from './auth'
import allPosts from './allPosts'
import myPosts from './myPosts'

const store = configureStore({
    reducer: {
        auth,
        allPosts,
        myPosts
    }
})

export default store;
